function loadData(){$.ajax({type:"GET",url:"data/surveyData.json",dataType:"json",success:function(o){console.log(o),transportation(o.totals.transportation)},error:function(o){console.log("Error "+o.status),console.log(o)}})}function transportation(o){var e=o.titles;o.data.forEach(function(o,a){for(var t=0;t<o;t++)switch(e[a]){case"Train":break;case"Bus":console.log("Bus");break;case"Car":console.log("Car");break;case"Walk":console.log("Walk");break;case"Bike":console.log("Bike");break;default:console.log("Other")}})}$(document).ready(function(){loadData()});